var sql = require('waf-sql');

//The mysql connection
params = {
	hostname:	'localhost',
	port:		3306,
    database:	'demo',
    user:		'root',
    password:	'',
	ssl:		false,
    dbType:		'mysql'
};

var session = sql.connect(params);

session.execute('delete from employee where 1');

var q = 'insert into employee values (?, ?, ?, ?, ?, ?, ?, ?, ?);';

var pstmt = session.createPreparedStatement(q);

var startTime = new Date().getTime();

for (var i = 0; i < 1000; ++i) {
    var value = values[i];
    pstmt.setNthParameter(1, value.id);
    pstmt.setNthParameter(2, value.firstname);
    pstmt.setNthParameter(3, value.lastname);
    pstmt.setNthParameter(4, value.gender);
    pstmt.setNthParameter(5, value.matricule);
    pstmt.setNthParameter(6, value.salary);
    pstmt.setNthParameter(7, value.experience);
    pstmt.setNthParameter(8, value.title);
	var avatarPath = application.getFolder().path + value.avatar;
    pstmt.setNthParameter(9, File(avatarPath).toBuffer().toBlob());
    pstmt.execute();
}
  
var endTime = new Date().getTime();

var deltaTime = endTime - startTime;
var x = 'total time = ' + Math.round(deltaTime/1000) + ' seconds.';
x;
